   class Solution {
       // Helper function to check if a string is a palindrome
       public boolean isPalindrome(String string) {
           int i = 0;
           int j = string.length() - 1;
           while (i < j) {
               if (string.charAt(i) != string.charAt(j)) {
                   return false;
               }
               i++;
               j--;
           }
           return true;
       }

       // Function to find the shortest palindrome that begins with a supplied string
       public String make_palindrome(String string) {
           if (string.isEmpty()) {
               return "";
           }

           int n = string.length();
           int longestPalindromicSuffixIndex = 0;

           // Find the longest palindromic suffix
           for (int i = 0; i < n; i++) {
               if (isPalindrome(string.substring(i))) {
                   longestPalindromicSuffixIndex = i;
                   break;
               }
           }

           // If no palindromic suffix found, append reverse of entire string
           if (longestPalindromicSuffixIndex == 0) {
               return string + new StringBuilder(string).reverse().toString();
           }

           // Append reverse of the prefix (before the palindromic suffix) to the end
           String prefix = string.substring(0, longestPalindromicSuffixIndex);
           return string + new StringBuilder(prefix).reverse().toString();
       }
   }

