class Solution {
    public int count_distinct_characters(String string) {
        // Convert the string to lowercase to handle case insensitivity
        String lowerCaseString = string.toLowerCase();

        // Create a Set to store distinct characters
        Set<Character> distinctCharacters = new HashSet<>();

        // Iterate through the string and add each character to the Set
        for (char c : lowerCaseString.toCharArray()) {
            distinctCharacters.add(c);
        }

        // The size of the Set is the count of distinct characters
        return distinctCharacters.size();
    }
}

