   class Solution {
       public List<Double> rescale_to_unit(List<Double> numbers) {
           // Find the minimum and maximum values in the list
           double min_value = Collections.min(numbers);
           double max_value = Collections.max(numbers);
           double range = max_value - min_value;

           // Create a new list to store the transformed values
           List<Double> transformed_list = new ArrayList<>();

           // Transform each number in the list
           for (double number : numbers) {
               double new_value = (number - min_value) / range;
               transformed_list.add(new_value);
           }

           // Return the transformed list
           return transformed_list;
       }
   }

