   class Solution {
       public int largest_divisor(int n) {
           if (n <= 1) {
               return 0;  // Edge case: no divisors for numbers less than or equal to 1
           }
           for (int i = n / 2; i > 0; i--) {
               if (n % i == 0) {
                   return i;
               }
           }
           return 1;  // Default case: 1 is always a divisor
       }
   }

