   class Solution {
       public boolean is_prime(int n) {
           if (n <= 1) {
               return false;
           }
           if (n == 2) {
               return true;
           }
           if (n % 2 == 0) {
               return false;
           }
           for (int i = 3; i <= Math.sqrt(n); i += 2) {
               if (n % i == 0) {
                   return false;
               }
           }
           return true;
       }
   }

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.is_prime(6),
                s.is_prime(101),
