class Solution {
    // Evaluates polynomial with coefficients xs at point x.
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    // Finds a zero of the polynomial using the Bisection Method.
    public double find_zero(List<Double> xs) {
        // Initial bounds for the Bisection Method
        double a = -100.0; // Arbitrary lower bound
        double b = 100.0;  // Arbitrary upper bound

        // Ensure a and b have opposite signs
        while (poly(xs, a) * poly(xs, b) > 0) {
            a *= 2;
            b *= 2;
        }

        // Bisection Method
        double tolerance = 1e-7; // Tolerance for convergence
        while (Math.abs(b - a) > tolerance) {
            double c = (a + b) / 2;
            double fc = poly(xs, c);

            if (Math.abs(fc) < tolerance) {
                return c; // Found a zero
            }

            if (poly(xs, a) * fc < 0) {
                b = c;
            } else {
                a = c;
            }
        }

        return (a + b) / 2; // Return the midpoint as the zero
    }
}

