    public boolean triples_sum_to_zero(List<Integer> l) {
        // Sort the list to optimize the search process
        Collections.sort(l);

        // Iterate through each element as the potential first element of the triplet
        for (int i = 0; i < l.size() - 2; i++) {
            // Use two pointers to find the other two elements that sum with the first element to zero
            int left = i + 1;
            int right = l.size() - 1;

            while (left < right) {
                int sum = l.get(i) + l.get(left) + l.get(right);

                if (sum == 0) {
                    // Found a triplet that sums to zero
                    return true;
                } else if (sum < 0) {
                    // If sum is less than zero, move the left pointer to increase the sum
                    left++;
                } else {
                    // If sum is greater than zero, move the right pointer to decrease the sum
                    right--;
                }
            }
        }

        // No such triplet found
        return false;
    }
}

