   class Solution {
       public List<Integer> sort_even(List<Integer> l) {
           List<Integer> even_values = new ArrayList<>();
           for (int i = 0; i < l.size(); i += 2) {
               even_values.add(l.get(i));
           }
           Collections.sort(even_values);
           List<Integer> result = new ArrayList<>(Collections.nCopies(l.size(), 0));
           int even_index = 0;
           for (int i = 0; i < l.size(); i++) {
               if (i % 2 == 0) {
                   result.set(i, even_values.get(even_index++));
               } else {
                   result.set(i, l.get(i));
               }
           }
           return result;
       }
   }

