   class Solution {
       public int largest_prime_factor(int n) {
           int largest_prime = 2;
           int current_number = n;

           // Divide out all factors of 2
           while (current_number % 2 == 0) {
               current_number /= 2;
           }

           // Check for odd factors from 3 upwards
           for (int i = 3; i <= Math.sqrt(current_number); i += 2) {
               while (current_number % i == 0) {
                   largest_prime = i;
                   current_number /= i;
               }
           }

           // If current_number is still greater than 2, then it is a prime factor
           if (current_number > 2) {
               largest_prime = current_number;
           }

           return largest_prime;
       }
   }

