   class Solution {
       public String circular_shift(int x, int shift) {
           String str_x = Integer.toString(x);
           int num_digits = str_x.length();

           if (shift > num_digits) {
               // Reverse the string
               StringBuilder reversed = new StringBuilder(str_x).reverse();
               return reversed.toString();
           } else {
               // Calculate effective shift
               int effective_shift = shift % num_digits;

               // Split the string into two parts
               String part1 = str_x.substring(num_digits - effective_shift);
               String part2 = str_x.substring(0, num_digits - effective_shift);

               // Concatenate part1 and part2
               return part1 + part2;
           }
       }
   }

