class Solution {
    public int search(List<Integer> lst) {
        // Step 1: Create a HashMap to store the frequency of each integer
        Map<Integer, Integer> frequencyMap = new HashMap<>();

        // Step 2: Populate the HashMap
        for (int num : lst) {
            frequencyMap.put(num, frequencyMap.getOrDefault(num, 0) + 1);
        }

        // Step 3: Initialize the result to -1 (default if no such integer is found)
        int result = -1;

        // Step 4: Iterate through the HashMap to find the greatest integer that meets the criteria
        for (Map.Entry<Integer, Integer> entry : frequencyMap.entrySet()) {
            int num = entry.getKey();
            int freq = entry.getValue();
            if (freq >= num && num > result) {
                result = num;
            }
        }

        // Step 5: Return the result
        return result;
    }
}

