class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        // Check if the list is empty
        if (q.isEmpty()) {
            return false;
        }

        // Calculate the sum of the elements in q
        int sum = 0;
        for (int num : q) {
            sum += num;
        }

        // Check if the sum is greater than the maximum possible weight
        if (sum > w) {
            return false;
        }

        // Create a reversed version of q
        List<Integer> reversedQ = new ArrayList<>(q);
        Collections.reverse(reversedQ);

        // Check if q is palindromic
        return q.equals(reversedQ);
    }
}

