class Solution {
    public String solve(int N) {
        // Initialize sum to 0
        int sum = 0;

        // Convert N to string to iterate through each digit
        String NStr = Integer.toString(N);

        // Loop through each character in the string representation of N
        for (char ch : NStr.toCharArray()) {
            // Convert character to integer and add to sum
            sum += Character.getNumericValue(ch);
        }

        // Convert sum to binary string
        String binarySum = Integer.toBinaryString(sum);

        // Return the binary string
        return binarySum;
    }
}

