class Solution {
    public String solve(int N) {
        // Step 1: Calculate the sum of digits of N
        int sum = 0;
        int temp = N;
        while (temp > 0) {
            sum += temp % 10;
            temp /= 10;
        }

        // Step 2: Convert the sum to a binary string
        String binarySum = Integer.toBinaryString(sum);

        // Step 3: Return the binary string
        return binarySum;
    }
