                s.is_bored("bIt") == 0,
                s.is_bored("I feel good today. I will be productive. will kill It") == 2,
                s.is_bored("You and I are going for a walk") == 0
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

