   class Solution {
       public boolean any_int(Object x, Object y, Object z) {
           // Check if all three objects are instances of Integer
           if (x instanceof Integer && y instanceof Integer && z instanceof Integer) {
               // Convert objects to integers
               int intX = (Integer) x;
               int intY = (Integer) y;
               int intZ = (Integer) z;

               // Check if any one of the integers is equal to the sum of the other two
               if (intX == intY + intZ || intY == intX + intZ || intZ == intX + intY) {
                   return true;
               }
           }
           return false;
       }
   }

