   class Solution {
       public List<Integer> sort_array(List<Integer> array) {
           if (array.isEmpty()) {
               return new ArrayList<>();
           }

           int first = array.get(0);
           int last = array.get(array.size() - 1);
           int sum = first + last;

           List<Integer> copy = new ArrayList<>(array);

           if (sum % 2 != 0) {
               // Sum is odd, sort in ascending order
               Collections.sort(copy);
           } else {
               // Sum is even, sort in descending order
               Collections.sort(copy, Collections.reverseOrder());
           }

           return copy;
       }
   }

