   class Solution {
       public List<List<Integer>> get_row(List<List<Integer>> lst, int x) {
           List<List<Integer>> coordinates = new ArrayList<>();

           // Iterate through each row and each element to find occurrences of x
           for (int i = 0; i < lst.size(); i++) {
               List<Integer> row = lst.get(i);
               for (int j = 0; j < row.size(); j++) {
                   if (row.get(j) == x) {
                       coordinates.add(Arrays.asList(i, j));
                   }
               }
           }

           // Sort coordinates first by row (ascending) and then by column (descending) within the same row
           coordinates.sort((a, b) -> {
               if (a.get(0).equals(b.get(0))) {
                   return b.get(1).compareTo(a.get(1));
               }
               return a.get(0).compareTo(b.get(0));
           });

           return coordinates;
       }
   }

