class Solution {
    public List<List<Integer>> get_row(List<List<Integer>> lst, int x) {
        List<List<Integer>> coordinates = new ArrayList<>();

        // Iterate through each row and each column to find occurrences of x
        for (int row = 0; row < lst.size(); row++) {
            for (int col = 0; col < lst.get(row).size(); col++) {
                if (lst.get(row).get(col) == x) {
                    coordinates.add(Arrays.asList(row, col));
                }
            }
        }

        // Sort the coordinates
        coordinates.sort((a, b) -> {
            // First by row in ascending order
            int rowComparison = a.get(0).compareTo(b.get(0));
            if (rowComparison != 0) {
                return rowComparison;
            }
            // For the same row, sort by column in descending order
            return b.get(1).compareTo(a.get(1));
        });

        return coordinates;
    }
}

