   class Solution {
       public int count_nums(List<Integer> arr) {
           int count = 0;
           for (int num : arr) {
               int sum = 0;
               boolean is_negative = num < 0;
               num = Math.abs(num);
               while (num > 0) {
                   int digit = num % 10;
                   if (is_negative) {
                       sum -= digit;
                   } else {
                       sum += digit;
                   }
                   num /= 10;
               }
               if (sum > 0) {
                   count++;
               }
           }
           return count;
       }
   }

