class Solution {
    public List<Integer> unique_digits(List<Integer> x) {
        List<Integer> result = new ArrayList<>();

        for (int number : x) {
            if (!containsEvenDigit(number)) {
                result.add(number);
            }
        }

        Collections.sort(result);
        return result;
    }

    private boolean containsEvenDigit(int number) {
        while (number > 0) {
            int digit = number % 10;
            if (digit % 2 == 0) {
                return true;
            }
            number /= 10;
        }
        return false;
    }
}

