class Solution {
    public boolean move_one_ball(List<Integer> arr) {
        if (arr.isEmpty()) {
            return true;
        }

        int n = arr.size();
        int rotationIndex = -1;

        // Find the rotation point
        for (int i = 0; i < n - 1; i++) {
            if (arr.get(i) > arr.get(i + 1)) {
                rotationIndex = i;
                break;
            }
        }

        // If no rotation point found, the array is already sorted
        if (rotationIndex == -1) {
            return true;
        }

        // Check if the subarrays are sorted
        for (int i = rotationIndex + 1; i < n - 1; i++) {
            if (arr.get(i) > arr.get(i + 1)) {
                return false;
            }
        }

        // Check if the last element of the first part is <= the first element of the second part
        return arr.get(n - 1) <= arr.get(0);
    }
}

