   class Solution {
       public List<Object> reverse_delete(String s, String c) {
           // Create a set from characters in c
           Set<Character> charSet = new HashSet<>();
           for (char ch : c.toCharArray()) {
               charSet.add(ch);
           }

           // Initialize an empty result string
           StringBuilder result = new StringBuilder();

           // Iterate through s and build the result string
           for (char ch : s.toCharArray()) {
               if (!charSet.contains(ch)) {
                   result.append(ch);
               }
           }

           // Check if the result string is a palindrome
           String resultStr = result.toString();
           String reversedStr = new StringBuilder(resultStr).reverse().toString();
           boolean isPalindrome = resultStr.equals(reversedStr);

           // Return the result string and the palindrome check result
           List<Object> resultList = new ArrayList<>();
           resultList.add(resultStr);
           resultList.add(isPalindrome);
           return resultList;
       }
   }

