class Solution {
    public int minSubArraySum(List<Integer> nums) {
        // Edge case: if the list is empty, return 0
        if (nums == null || nums.size() == 0) {
            return 0;
        }

        // Initialize variables
        int min_ending_here = nums.get(0);
        int min_so_far = nums.get(0);

        // Iterate through the list starting from the second element
        for (int i = 1; i < nums.size(); i++) {
            int current = nums.get(i);
            // Update min_ending_here
            min_ending_here = Math.min(current, min_ending_here + current);
            // Update min_so_far
            min_so_far = Math.min(min_so_far, min_ending_here);
        }

        // Return the minimum sub-array sum found
        return min_so_far;
    }
}

