           // List to store the result words
           List<String> result = new ArrayList<>();

           // Split the string into words
           String[] words = s.split(" ");

           // Iterate over each word
           for (String word : words) {
               // Count the number of consonants in the word
               int consonantCount = countConsonants(word);

               // If the count matches n, add the word to the result list
               if (consonantCount == n) {
                   result.add(word);
               }
           }

           // Return the result list
           return result;
       }

       // Helper function to count consonants in a word
       private int countConsonants(String word) {
           int count = 0;
           for (char c : word.toCharArray()) {
               if (isConsonant(c)) {
                   count++;
               }
           }
           return count;
       }

       // Helper function to check if a character is a consonant
       private boolean isConsonant(char c) {
           // Convert to lowercase to handle both uppercase and lowercase letters
           c = Character.toLowerCase(c);
           // Check if the character is a letter and not a vowel
           return Character.isLetter(c) && "aeiou".indexOf(c) == -1;
       }
   }

