class Solution {
    public String match_parens(List<String> lst) {
        // Initialize counters for open and close parentheses
        int open1 = 0, close1 = 0, open2 = 0, close2 = 0;

        // Count parentheses in the first string
        for (char c : lst.get(0).toCharArray()) {
            if (c == '(') open1++;
            else close1++;
        }

        // Count parentheses in the second string
        for (char c : lst.get(1).toCharArray()) {
            if (c == '(') open2++;
            else close2++;
        }

        // Total open and close parentheses
        int totalOpen = open1 + open2;
        int totalClose = close1 + close2;

        // Check if the total number of open parentheses equals the total number of close parentheses
        if (totalOpen == totalClose) {
            return "Yes";
        }

        // Check if the difference can be balanced by swapping the order of concatenation
        if (Math.abs(totalOpen - totalClose) == Math.abs(open1 - close1) + Math.abs(open2 - close2)) {
            return "Yes";
        }

        // If neither condition is met, return "No"
        return "No";
    }
}

