class Solution {
    public List<Integer> sort_array(List<Integer> arr) {
        // Custom comparator to sort based on number of ones in binary representation
        Comparator<Integer> customComparator = new Comparator<Integer>() {
            @Override
            public int compare(Integer a, Integer b) {
                // Count number of ones in binary representation
                int countOnesA = Integer.bitCount(a);
                int countOnesB = Integer.bitCount(b);

                // Compare based on number of ones
                if (countOnesA != countOnesB) {
                    return countOnesA - countOnesB;
                }

                // If number of ones is the same, compare based on decimal value
                return a - b;
            }
        };

        // Sort the array using the custom comparator
        Collections.sort(arr, customComparator);

        return arr;
    }
}

