    public List<Integer> get_odd_collatz(int n) {
        List<Integer> odd_numbers = new ArrayList<>();

        while (n != 1) {
            if (n % 2 != 0) { // Check if n is odd
                odd_numbers.add(n);
            }
            if (n % 2 == 0) { // If n is even
                n = n / 2;
            } else { // If n is odd
                n = 3 * n + 1;
            }
        }

        // Add 1 to the list since it is always the last number in the sequence
        odd_numbers.add(1);

        // Sort the list in increasing order
        Collections.sort(odd_numbers);

        return odd_numbers;
    }
}

