class Solution {
    public boolean is_sorted(List<Integer> lst) {
        if (lst.size() <= 1) return true; // A single element list is always sorted

        Set<Integer> countSet = new HashSet<>();
        for (int i = 0; i < lst.size() - 1; i++) {
            int current = lst.get(i);
            int next = lst.get(i + 1);

            if (current > next) {
                return false; // Not sorted in ascending order
            }

            if (countSet.contains(current)) {
                if (countSet.contains(current + 1)) {
                    return false; // Number appears more than twice
                }
                countSet.add(current + 1); // Increment the count
            } else {
                countSet.add(current);
            }
        }

        // Check the last element
        int last = lst.get(lst.size() - 1);
        if (countSet.contains(last)) {
            if (countSet.contains(last + 1)) {
                return false; // Number appears more than twice
            }
            countSet.add(last + 1); // Increment the count
        } else {
            countSet.add(last);
        }

        return true;
    }
}

