   class Solution {
       public Optional<Integer> prod_signs(List<Integer> arr) {
           if (arr.isEmpty()) {
               return Optional.empty();
           }

           int sum_of_magnitudes = 0;
           int sign_product = 1;

           for (int num : arr) {
               sum_of_magnitudes += Math.abs(num);
               if (num == 0) {
                   sign_product = 0;
                   break;
               } else if (num < 0) {
                   sign_product *= -1;
               }
           }

           if (sign_product == 0) {
               return Optional.of(0);
           } else {
               return Optional.of(sum_of_magnitudes * sign_product);
           }
       }
   }

