class Solution {
    public int digits(int n) {
        String numStr = Integer.toString(n);
        int product = 1;
        boolean oddFound = false;

        for (char ch : numStr.toCharArray()) {
            int digit = Character.getNumericValue(ch);
            if (digit % 2 != 0) {
                product *= digit;
                oddFound = true;
            }
        }

        if (!oddFound) {
            return 0;
        }

        return product;
    }
}

