               if (a instanceof Comparable && b instanceof Comparable) {
                   Comparable compA = (Comparable) a;
                   Comparable compB = (Comparable) b;
                   int comparison = compA.compareTo(compB);
                   if (comparison > 0) {
                       return Optional.of(a);
                   } else if (comparison < 0) {
                       return Optional.of(b);
                   } else {
                       return Optional.empty();
                   }
               }
           }

           // Convert both objects to double for comparison
           double doubleA = convertToDouble(a);
           double doubleB = convertToDouble(b);

           // Compare the converted doubles
           if (doubleA > doubleB) {
               return Optional.of(a);
           } else if (doubleB > doubleA) {
               return Optional.of(b);
           } else {
               return Optional.empty();
           }
       }

       private double convertToDouble(Object obj) {
           if (obj instanceof Number) {
               return ((Number) obj).doubleValue();
           } else if (obj instanceof String) {
               String str = (String) obj;
               str = str.replace(',', '.');
               return Double.parseDouble(str);
           }
           throw new IllegalArgumentException("Unsupported type: " + obj.getClass());
       }
   }

