           if (dotCount != 1) {
               return "No";
           }

           // Split the file name into before_dot and after_dot
           String[] parts = file_name.split("\\.");
           String before_dot = parts[0];
           String after_dot = parts[1];

           // Check if before_dot is not empty and starts with a Latin alphabet letter
           if (before_dot.isEmpty() || !Character.isLetter(before_dot.charAt(0))) {
               return "No";
           }

           // Count digits in before_dot
           int digitCount = 0;
           for (char c : before_dot.toCharArray()) {
               if (Character.isDigit(c)) {
                   digitCount++;
               }
           }
           if (digitCount > 3) {
               return "No";
           }

           // Check if after_dot is one of ["txt", "exe", "dll"]
           List<String> allowedExtensions = Arrays.asList("txt", "exe", "dll");
           if (!allowedExtensions.contains(after_dot)) {
               return "No";
           }

           return "Yes";
       }
   }

