   class Solution {
       public int specialFilter(List<Integer> nums) {
           int count = 0;
           for (int num : nums) {
               if (num > 10) {
                   String numStr = Integer.toString(Math.abs(num));
                   char firstDigit = numStr.charAt(0);
                   char lastDigit = numStr.charAt(numStr.length() - 1);
                   if (isOddDigit(firstDigit) && isOddDigit(lastDigit)) {
                       count++;
                   }
               }
           }
           return count;
       }

       private boolean isOddDigit(char digit) {
           int digitValue = Character.getNumericValue(digit);
           return digitValue % 2 != 0;
       }
   }

