    public List<Integer> order_by_points(List<Integer> nums) {
        // Custom comparator to sort based on digit sum
        Comparator<Integer> digitSumComparator = new Comparator<Integer>() {
            @Override
            public int compare(Integer a, Integer b) {
                int sumA = sumOfDigits(a);
                int sumB = sumOfDigits(b);
                return Integer.compare(sumA, sumB);
            }
        };

        // Sort the list using the custom comparator
        Collections.sort(nums, digitSumComparator);

        return nums;
    }

    // Helper function to calculate the sum of digits of a number
    private int sumOfDigits(int num) {
        int sum = 0;
        boolean isNegative = num < 0;
        num = Math.abs(num);

        while (num > 0) {
            sum += num % 10;
            num /= 10;
        }

        return isNegative ? -sum : sum;
    }
}

