   class Solution {
       public boolean right_angle_triangle(int a, int b, int c) {
           int hypotenuse, side1, side2;

           // Determine the hypotenuse (longest side)
           if (a > b && a > c) {
               hypotenuse = a;
               side1 = b;
               side2 = c;
           } else if (b > a && b > c) {
               hypotenuse = b;
               side1 = a;
               side2 = c;
           } else {
               hypotenuse = c;
               side1 = a;
               side2 = b;
           }

           // Check the Pythagorean theorem
           return hypotenuse * hypotenuse == side1 * side1 + side2 * side2;
       }
   }

