class Solution {
    public int do_algebra(List<String> operator, List<Integer> operand) {
        // Initialize the result with the first operand
        int result = operand.get(0);

        // Loop through the operator list
        for (int i = 0; i < operator.size(); i++) {
            // Get the current operator and the next operand
            String op = operator.get(i);
            int nextOperand = operand.get(i + 1);

            // Apply the corresponding operation
            switch (op) {
                case "+":
                    result += nextOperand;
                    break;
                case "-":
                    result -= nextOperand;
                    break;
                case "*":
                    result *= nextOperand;
                    break;
                case "/":
                    result /= nextOperand;
                    break;
                case "**":
                    result = (int) Math.pow(result, nextOperand);
                    break;
                default:
                    throw new IllegalArgumentException("Invalid operator: " + op);
            }
        }

        // Return the final result
        return result;
    }
}

