import java.math.BigInteger;
import java.util.stream.Collectors;
import java.security.*;
import java.util.*;
import java.lang.*;
import java.util.*;

class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int N = grid.size();
        List<Integer> bestPath = null;

        // Directions for moving up, down, left, right
        int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

        // Queue for BFS
        Queue<List<Object>> queue = new LinkedList<>();

        // Start BFS from each cell
        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                List<Integer> initialPath = new ArrayList<>();
                initialPath.add(grid.get(i).get(j));
                queue.add(Arrays.asList(i, j, initialPath));
            }
        }

        while (!queue.isEmpty()) {
            List<Object> current = queue.poll();
            int x = (int) current.get(0);
            int y = (int) current.get(1);
            List<Integer> path = (List<Integer>) current.get(2);

            // If path length is k, compare and update bestPath
            if (path.size() == k) {
                if (bestPath == null || isLexicographicallySmaller(path, bestPath)) {
                    bestPath = new ArrayList<>(path);
                }
                continue;
            }

            // Explore neighbors
            for (int[] dir : directions) {
                int newX = x + dir[0];
                int newY = y + dir[1];

                if (newX >= 0 && newX < N && newY >= 0 && newY < N) {
                    List<Integer> newPath = new ArrayList<>(path);
                    newPath.add(grid.get(newX).get(newY));
                    queue.add(Arrays.asList(newX, newY, newPath));
                }
            }
        }

        return bestPath;
    }

    private boolean isLexicographicallySmaller(List<Integer> path1, List<Integer> path2) {
        for (int i = 0; i < path1.size(); i++) {
            if (path1.get(i) < path2.get(i)) {
                return true;
            } else if (path1.get(i) > path2.get(i)) {
                return false;
            }
        }
        return false;
    }
}

