class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int N = grid.size();
        List<Integer> minPath = null;

        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                List<Integer> path = bfs(grid, i, j, k);
                if (minPath == null || isLexicographicallySmaller(path, minPath)) {
                    minPath = path;
                }
            }
        }

        return minPath;
    }

    private List<Integer> bfs(List<List<Integer>> grid, int startX, int startY, int k) {
        int N = grid.size();
        Queue<List<Integer>> queue = new LinkedList<>();
        List<Integer> initialPath = new ArrayList<>();
        initialPath.add(grid.get(startX).get(startY));
        queue.add(initialPath);

        while (!queue.isEmpty()) {
            List<Integer> currentPath = queue.poll();
            int pathLength = currentPath.size();

            if (pathLength == k) {
                return currentPath;
            }

            int lastX = startX;
            int lastY = startY;
            for (int i = 0; i < pathLength - 1; i++) {
                lastX += (currentPath.get(i + 1) - currentPath.get(i)) / N;
                lastY += (currentPath.get(i + 1) - currentPath.get(i)) % N;
            }

            int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
            for (int[] dir : directions) {
                int newX = lastX + dir[0];
                int newY = lastY + dir[1];

                if (newX >= 0 && newX < N && newY >= 0 && newY < N) {
                    List<Integer> newPath = new ArrayList<>(currentPath);
                    newPath.add(grid.get(newX).get(newY));
                    queue.add(newPath);
                }
            }
        }

        return new ArrayList<>();
    }

    private boolean isLexicographicallySmaller(List<Integer> path1, List<Integer> path2) {
        for (int i = 0; i < path1.size(); i++) {
            if (path1.get(i) < path2.get(i)) {
                return true;
            } else if (path1.get(i) > path2.get(i)) {
                return false;
            }
        }
        return false;
    }
}

