    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        N = grid.size();
        minPath = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            minPath.add(Integer.MAX_VALUE);
        }

        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                dfs(grid, i, j, new ArrayList<>(), k);
            }
        }

        return minPath;
    }

    private void dfs(List<List<Integer>> grid, int x, int y, List<Integer> currentPath, int k) {
        if (currentPath.size() == k) {
            if (comparePaths(currentPath, minPath) < 0) {
                minPath = new ArrayList<>(currentPath);
            }
            return;
        }

